// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MDCNCommand {
    enum Role {
        None,
        Strategic,
        Operational,
        Tactical
    }

    struct Command {
        uint256 id;
        address sender;
        uint8 layer; // 1: Strategic, 2: Operational, 3: Tactical
        string commandText;
        uint256 timestamp;
        bool executed;
    }

    uint256 public commandCount;
    mapping(uint256 => Command) public commands;
    mapping(address => Role) public roles;

    event CommandSent(
        uint256 indexed id,
        address indexed sender,
        uint8 layer,
        string commandText,
        uint256 timestamp
    );
    event CommandExecuted(
        uint256 indexed id,
        address indexed executor,
        uint256 timestamp
    );
    event RoleAssigned(address indexed account, Role role);

    modifier onlyRole(Role required) {
        require(
            uint8(roles[msg.sender]) >= uint8(required) ||
                roles[msg.sender] == Role.Strategic,
            "Unauthorized: insufficient role"
        );
        _;
    }

    constructor() {
        // The deployer is assumed to be Strategic.
        roles[msg.sender] = Role.Strategic;
        emit RoleAssigned(msg.sender, Role.Strategic);
    }

    // Strategic-level accounts can assign roles to others.
    function assignRole(
        address _account,
        Role _role
    ) public onlyRole(Role.Strategic) {
        roles[_account] = _role;
        emit RoleAssigned(_account, _role);
    }

    // Send command â€“ only those with an equal or higher role than the selected layer can issue commands.
    function sendCommand(uint8 _layer, string memory _commandText) public {
        require(
            uint8(roles[msg.sender]) >= _layer,
            "Unauthorized: Insufficient role"
        );
        commandCount++;
        commands[commandCount] = Command(
            commandCount,
            msg.sender,
            _layer,
            _commandText,
            block.timestamp,
            false
        );
        emit CommandSent(
            commandCount,
            msg.sender,
            _layer,
            _commandText,
            block.timestamp
        );
    }

    // Mark a command as executed.
    function executeCommand(uint256 _commandId) public {
        Command storage cmd = commands[_commandId];
        require(cmd.id != 0, "Command does not exist");
        require(
            msg.sender == cmd.sender || uint8(roles[msg.sender]) >= cmd.layer,
            "Unauthorized execution"
        );
        cmd.executed = true;
        emit CommandExecuted(_commandId, msg.sender, block.timestamp);
    }
}

